        {% block stylesheets%}

        {% endblock %}
    </head>
    <body>
    {% block nav %}
        <nav>
            {% if is_granted('ROLE_ADMIN') %}
                <p class=\"crud_title\">Crud Panels</p>
                <div class=\"admin_wrapper\">
                    <p><a href=\"{{ path('user_index') }}\">Users</a></p>
                    <p class=\"logboek_crud\"><a href=\"{{ path('logboek_index') }}\">Logboek</a></p>
                    <p class=\"trucks_crud\"><a href=\"{{ path('truck_index') }}\">Trucks</a></p>
                </div>
            {% endif %}
            <ul>
                <li><a href=\"/\">Home</a></li>
                {% if is_granted('IS_AUTHENTICATED_FULLY') %}<li><a href=\"{{ path('fos_user_security_logout') }}\">logout</a></li>{% endif %}
                {% if app.user %}
                {% else %}
                <li><a href=\"{{ path('fos_user_security_login') }}\">Login</a></li>
                <li><a href=\"{{ path('fos_user_registration_register') }}\">Register</a></li>
                {% endif %}
            </ul>
        </nav>
    {% endblock %}
